import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {Route} from "react-router";
import Root from "./Root/Root";
import {BrowserRouter} from "react-router-dom";
import PlantStats from "./Stats/plantstats/plantstats";
import TextFields from "./TextFields/textfields";
import Navigation1 from "./Navigation/Navigation1";
import Navigation from "./Navigation/Navigation";


ReactDOM.render(
    <BrowserRouter>
            <Route path="/" component={App} />
            <Route path="/root" component={Root} />
            <Route path="/signin" component={Navigation} />
            <Route path="/plantstats" component={Navigation1}/>
    </BrowserRouter>,
    document.getElementById('root')
);

ReactDOM.render(
    <BrowserRouter>
            <Route path="/signin" component={TextFields} />
            <Route path="/plantstats" component={PlantStats}/>
    </BrowserRouter>,
    document.getElementById('bro')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
